window.bookSummaryJSON = "<p>Hugo, Locus, and Nebula Award winner Mary Robinette Kowal blends her no-nonsense approach to life in space with her talent for creating glittering high-society in this stylish SF mystery, <i>The Spare Man</i>.</p> <p>Tesla Crane, one of the richest women in the world, is on her honeymoon on an interplanetary space liner, cruising between Earth and Mars. Sheâ€™s traveling incognito and is reveling in her anonymity. Then someone is murdered and her husband is named as the prime suspect. To save him from the frame-up, Tesla will risk exposure and face demons from her past.</p> <p>Even though doing so might make her the next victim.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
